import React, {useState} from 'react'
import BasePageWithCard from './BasePageWithCard'
import EditSecretaryProfileForm from '../components/Forms/EditProfile/Secretary/EditSecretaryProfileForm'

function EditSecretaryProfile({secretaryData}) {
  const [darkMode, setDarkMode] = useState(false);
  const toggleTheme = () => {
    setDarkMode(prevDarkMode => !prevDarkMode);
  };
  return (
   
    <BasePageWithCard isAuthenticated={true} data={secretaryData}>
    <EditSecretaryProfileForm secretaryData={secretaryData} darkMode={darkMode}/>
    </BasePageWithCard>
  )
}

export default EditSecretaryProfile
